INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 0, 1, 1.4, 0, 1001, "春咲 ひより", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, "お！\nあそこに困ってそうな人発見！", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 0, 1, 1.4, 0, 1002, "草野 優衣", "みんなみたいに\nわたしも強くならなきゃ", 1, "大切な人を\n守れるようになりたい…って", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "少しは磨かれると思いますよ。", 0, 0, 1, 1.4, 0, 1003, "士条 怜", "フェンシングを始めてみては？", 1, "キミに必要な集中力と感性が", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "みそぎはねぇ、\nかくれんぼやりたい！", 0, 0, 1, 1.5, 0, 1004, "穂高 みそぎ", "ねぇ、にいちゃん！", 1, "今日はなにして遊ぶ？", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "私といっしょに…\nいかない？", 0, 0, 1, 1.4, 0, 1006, "風宮 あかり", "風宮あかりです", 1, "ねぇ…", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "食べ物の恨みは怖いのー", 0, 0, 1, 1.5, 0, 1007, "出雲 宮子", "出雲宮子なのー", 1, "プリンたべたいのー", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "いいよ。\n見られることは運命さ…", 0, 0, 1, 1.4, 0, 1008, "虹村 雪", "ボクは虹村雪。", 1, "キミもボクの美貌に\n吸い寄せられたんだね。", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "人呼んで「疾風の冥姫」!!", 0, 0, 1, 1.4, 0, 1009, "柊杏奈", "フッ…聞いて後悔するがいい！", 1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "ほんまおおきにやわ～♪", 0, 0, 1, 1.5, 0, 1010, "姫宮 真歩", "マホマホ王国のプリンセス、\nまほ姫どす", 1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "ここで会ったが\n100年目～！", 0, 0, 1, 1.4, 0, 1011, "衣之咲 璃乃", "衣之咲璃乃です！", 1, "生き別れたお兄ちゃんを探して\n三千世界！", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "…って、お願い！\n誰にも言わないでおいて～！", 0, 0, 1, 1.4, 0, 1012, "柏崎 初音", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, "ち、超能力って…\n何のことかな～？", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 0, 1, 1.4, 0, 1016, "美波 鈴奈", "ちょす！\n美波鈴奈だよ～♪", 1, "一応カリスマ読モJKやってまっす！", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "でも、沖縄もとってもいいとこさー", 0, 0, 1, 1.4, 0, 1017, "喜屋武 香織", "はいたーい。\n喜屋武香織さー。", 1, "東京は遊園地みたいなところさー", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "イオちゃんって呼んでね。", 0, 0, 1, 1.4, 0, 1018, "支倉 伊緒", "支倉伊緒です。", 1, "先生って呼ばれるのは\nくすぐったいから", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "ミミをおいてかないでぇ～", 0, 0, 1, 1.5, 0, 1020, "茜 ミミ", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, "あ！/\お兄ちゃ～ん\nまってよ～", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "ふぇぇぇぇぇん……", 0, 0, 1, 1.5, 0, 1021, "栗林 くるみ", "あ…あの…えっと…\n栗…林…くるみ…です……", 1, "あの……\nふぇ……", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "なんてありがとうございます！", 0, 0, 1, 1.4, 0, 1022, "風宮 より", "風宮よりです。\nあああああ！", 1, "こんな私に貴重な時間を\n割いていただき、", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "私こっち行きたいー\nね、早く早くー", 0, 0, 1, 1.5, 0, 1023, "北条 綾音", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, "おにいちゃんどこいくの？\nえ？", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "これて何か違う…\nあああすみません！", 0, 0, 1, 1.4, 0, 1025, "天野 すずめ", "わっ…わっ…私、\n天野すずめといいます！", 1, "ふ、不束者ですが\nどうぞ末永く…って、", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "離しませんわ………\n絶対に…!!", 0, 0, 1, 1.4, 0, 1027, "倉石 恵理子", "……クスクス…私は\n…倉石恵理子……", 1, "あなたは…運命の……\n伴侶……", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "…そうでしょ？？", 0, 0, 1, 1.4, 0, 1028, "佐々木 咲恋", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "あはは、\n私もまだまだだなぁ～", 0, 0, 1, 1.4, 0, 1029, "桜井 望", "桜井望だよ！\nよろしくねっ", 1, "ぇっと…\nキミ、私のこと知らないの?!", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "ショーグン、\nワタシと一緒に天下統一デース！", 0, 0, 1, 1.4, 0, 1030, "ニノン・ジュベール", "デケデケデンっ！", 1, "初めまして、\n私はニノン・ジュベール申すデス！", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "おかしいですね……", 0, 0, 1, 1.4, 0, 1031, "上喜 しのぶ", "上喜しのぶです。\n手元のドクロが父です。", 1, "でもって私の隣にいるのが……\nえ、見えない？", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "そう、\nオラのボケに突っ込める相方が…！", 0, 0, 1, 1.5, 0, 1033, "野戸まひる", "目指すはビッグな\nお笑い芸人だっぺ！", 1, "けんども\nそれには足りないモンが…", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "ちょ\nちょっと一杯飲んできます…！", 0, 0, 1, 1.4, 0, 1034, "綾瀬 ゆかり", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1, "ちょっと緊張しちゃって…", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "これ以上お話しすることは…\nないです！", 0, 0, 1, 1.5, 0, 1036, "氷川 鏡華", "氷川鏡華…です", 1, "知らない人とは話しちゃいけないので", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 0, 1, 1.4, 0, 1038, "柏崎 栞", "柏崎…栞です。", 1, "……あ、アラーム。", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "野に咲く花が、\n唯一の話相手です。", 0, 0, 1, 1.4, 0, 1040, "双葉 碧", "ふ、双葉碧です。", 1, "私、一人も友達がいなくて……", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "そう思っています。", 0, 0, 1, 1.4, 0, 1042, "三角 千歌", "三角千歌です。", 1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "う、疑ってすまなかったな…", 0, 0, 1, 1.4, 0, 1043, "安芸 真琴", "安芸真琴だ。", 1, "あぁ？\nお前のそいつの仲間か？", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 0, 1, 1.4, 0, 1044, "イリヤ・オーンスタイン", "わらわこそは夜を総べる者！", 1, "生けとし生ける全ての者よ！", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "ｌク、クウカに何かご用ですか!?", 0, 0, 1, 1.4, 0, 1045, "遠見 空花", "そこで騎士は妖精を乱暴に……", 1, "ぐふふふふ……はっ！", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "う～ん…\n猫ってホントに最高にゃ～♪", 0, 0, 1, 1.4, 0, 1046, "宮坂たまき", "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 0, 1, 1.4, 0, 1048, "大神 美冬", "大神美冬よ！", 1, "それでは早速クエストに…", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 0, 1, 1.4, 0, 1049, "星野静流", "星野静流だよ！", 1, "クエストもバトルも\n掃除も洗濯も", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 0, 1, 1.5, 0, 1050, "玉泉美咲", "アタシは玉泉美咲。", 1, "見ての通りの\nセクシー美少女で", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "？？？？", 0, 0, 1, 1.4, 0, 1052, "リマ", "？？？", 1, "？？？？", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "そ、そこまでいうなら\nもらってやる", 0, 0, 1, 1.5, 0, 1053, "モニカ・ヴァイスヴィント", "モニカ・ヴァイスヴィントだ。", 1, "菓子でつろうなどと\n稚拙な策を……", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "そ、そこまでいうなら\nもらってやる", 0, 0, 1, 1.5, 0, 1058, "ペコリーヌ", "モニカ・ヴァイスヴィントだ。", 1, "菓子でつろうなどと\n稚拙な策を……", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "そ、そこまでいうなら\nもらってやる", 0, 0, 1, 1.5, 0, 1059, "コッコロ", "モニカ・ヴァイスヴィントだ。", 1, "菓子でつろうなどと\n稚拙な策を……", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, 1, 2, "そ、そこまでいうなら\nもらってやる", 0, 0, 1, 1.5, 0, 1060, "キャル", "モニカ・ヴァイスヴィントだ。", 1, "菓子でつろうなどと\n稚拙な策を……", 0);
